def parse_grammar(grammar_string):
    """Parses a grammar string and returns a dictionary of grammar rules."""
    grammar = {}
    lines = grammar_string.strip().split('\n')
    for line in lines:
        parts = line.split()
        if len(parts) == 1:
            if parts[0] == "S":
                grammar["S"] = parts[0]
        else:
            for i in range(len(parts)):
                if parts[i] == "NT":
                    grammar[parts[i]] = parts[i+1]
    return grammar

